<!DOCTYPE html>
 <html lang="en">
 <head>
     <meta charset="UTF-8">
     <meta http-equiv="X-UA-Compatible" content="IE=edge">
     <meta name="viewport" content="width=device-width, initial-scale=1.0">
     <title>Feedback</title>
     <link rel="stylesheet" href="Feedback.css">
 </head>
 <body>
    <div class="feedback screen">
        <div class="overlap-group3">
            <img class="right-arrow-png-transparent-24-8" src="right-arrow-png-transparent-24.png" />
        </div>

        <h1 class="feed-us-back">
            <span class="span0">FEED us <br/>  </span>
            <span class="span1">BACK</span>
        </h1>

        <img class="indo-china-food-is-hard-to-find--except-in-new-jersy" src="Indo-Chinese Food Is Hard to Find, Except in New Jersey (Published 2017).jpg"

        <p class="lets-know-what-u-feel inter-extra-bold-black-16px">Lets know what u feel</p>

        <div class="feed-item inter-semi-bold-black-14px">Customer Name</div>
        <div class="overlap-group border-1px-black-4">
            <div class="enter-name inter-medium-black-14px-2">Enter Name</div>
        </div>

        <div class="email inter-semi-bold-black-14px">Email</div>
        <div class="overlap-group border-1px-black-4">
            <div class="enter-email inter-medium-black-14px-2">Enter Email</div>
        </div>

        <div class="mobile-number inter-semi-bold-black-14px">Mobile Number</div>
        <div class="overlap-group border-1px-black-4">
            <div class="enter-mobile-number inter-medium-black-14px-2">Enter Mobile Number</div>
        </div>

        <div class="express-ur-experience inter-extra-bold-black-16px">Express ur experience</div>
        <div class="feedback-item inter-semi-bold-black-14px">Your Feedback</div>

        <div class="overlap-group5 border-1px-black-4">
            <div class="enter-your-feedback inter-medium-black-14px-2">Enter Your Feedback</div>
        </div>

        <div class="overlap-group-1">
            <div class="submit">Submit</div>
        </div>
     </div>
    













 </body>
 </html>
